import React from 'react';
import styled from "styled-components";
import {Title} from "../../styles/common";

const StyledLogo = styled.a`
  display: flex;
  align-items: center;
  gap: 0.46rem;
`

const LogoTitle = styled(Title)`
  font-size: 2.11111rem;
  font-weight: 700;
`

function Logo() {
  return (
    <div>
      <StyledLogo href="/">
        <img src="./img/common/logo.svg" alt="Logo"/>
        <LogoTitle>Organick</LogoTitle>
      </StyledLogo>
    </div>
  );
}

export default Logo;
